import '../style/Header.css'
import { useState } from 'react'

const Header = () => {

    const [navList, setNavList] = useState([
        {id: 1, text: 'Non-Profits', link: '#', active: false},
        {id: 2, text: 'Send Email', link: '#', active: false}
    ]);

    const handleSelect = (id) => {
        const updatedList = navList.map((entry) => id === entry.id ? {...entry, active: true} : {...entry, active: false});
        setNavList(updatedList);
    }

    return (
        <nav>
            <label>
                    Temelio Fund Manager
            </label>
            <ul>
                {navList.map((entry) => (
                    <li>
                        <a 
                            key={entry.id}
                            className={entry.active ? 'active': ''}
                            href={entry.link}
                            onClick={() => handleSelect(entry.id)}
                        >
                            {entry.text}
                        </a>
                    </li>
                ))}
            </ul>
        </nav>
    );
}

export default Header;
